import{_ as r,c as d,o as e,a9 as p,ag as h,ah as i,ai as s,aj as l,ak as o,al as n,am as c,an as b,ao as m,ap as _,aq as t,ar as u,as as q,at as g,au as f,av as k,aw as x,ax as P,ay as y,az as v,aA as w,aB as S,aC as C,aD as T,aE as A,aF as B,aG as N,aH as V,aI as D,aJ as E,aK as $,aL as M,aM as H,aN as I,aO as R,aP as W,aQ as X,aR as Z,aS as J,aT as O,aU as Q,aV as U,aW as Y,aX as j,aY as z,aZ as F,a_ as G,a$ as K,b0 as L,b1 as tt,b2 as at,b3 as a,b4 as rt,b5 as dt,b6 as et,b7 as pt,b8 as ht,b9 as it,ba as st,bb as lt,bc as ot,bd as nt,be as ct,bf as bt}from"./chunks/framework.CdWXdKVz.js";const wt=JSON.parse('{"title":"冒险者传说","description":"","frontmatter":{},"headers":[],"relativePath":"catship.md","filePath":"catship.md","lastUpdated":1727864871000}'),mt={name:"catship.md"},_t=p('<h1 id="冒险者传说" tabindex="-1">冒险者传说 <a class="header-anchor" href="#冒险者传说" aria-label="Permalink to &quot;冒险者传说&quot;">​</a></h1><p>这一世，我重生了，上一世我被 boss 血虐，这次，我要用我上一世的记忆翻盘。</p><h1 id="下载" tabindex="-1">下载 <a class="header-anchor" href="#下载" aria-label="Permalink to &quot;下载&quot;">​</a></h1><p>官方下载地址：<a href="https://pan.baidu.com/s/1u40vHDXPEMZ_2eqr8SAgmw" target="_blank" rel="noreferrer">https://pan.baidu.com/s/1u40vHDXPEMZ_2eqr8SAgmw</a></p><p>提取码：21ru</p><h1 id="搜刮" tabindex="-1">搜刮 <a class="header-anchor" href="#搜刮" aria-label="Permalink to &quot;搜刮&quot;">​</a></h1><p>参考：</p><ul><li><a href="https://www.bilibili.com/video/BV1Wy411b7N3" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1Wy411b7N3</a></li><li><a href="https://tieba.baidu.com/p/8900830529" target="_blank" rel="noreferrer">https://tieba.baidu.com/p/8900830529</a></li></ul><h2 id="开始" tabindex="-1">开始 <a class="header-anchor" href="#开始" aria-label="Permalink to &quot;开始&quot;">​</a></h2><h3 id="开始房间" tabindex="-1">开始房间 <a class="header-anchor" href="#开始房间" aria-label="Permalink to &quot;开始房间&quot;">​</a></h3><p><img src="'+h+'" alt=""></p><p>在开始房间的箱子中可以得到一个附魔金苹果</p><p>接着选择单人普通模式，可以得到这些东西</p><p><img src="'+i+'" alt=""></p><p>我选择魔力使</p><p><img src="'+s+'" alt=""></p><h3 id="隐藏箱子" tabindex="-1">隐藏箱子 <a class="header-anchor" href="#隐藏箱子" aria-label="Permalink to &quot;隐藏箱子&quot;">​</a></h3><p>站在箱子上，对着这幅画立定跳远，多试几次</p><p><img src="'+l+'" alt=""></p><p>里面有一个箱子</p><p><img src="'+o+'" alt=""></p><h3 id="箱子下的熔炉" tabindex="-1">箱子下的熔炉 <a class="header-anchor" href="#箱子下的熔炉" aria-label="Permalink to &quot;箱子下的熔炉&quot;">​</a></h3><p>在这里，箱子下面的熔炉里有 1 枚 钻石钱币</p><p><img src="'+n+'" alt=""></p><h3 id="南瓜灯" tabindex="-1">南瓜灯 <a class="header-anchor" href="#南瓜灯" aria-label="Permalink to &quot;南瓜灯&quot;">​</a></h3><p>对着南瓜灯的按钮点按，可以得到 8 个 精铁钱币 和 1 枚细心者之戒</p><p><img src="'+c+'" alt=""></p><h3 id="收益" tabindex="-1">收益 <a class="header-anchor" href="#收益" aria-label="Permalink to &quot;收益&quot;">​</a></h3><table><thead><tr><th>项目</th><th>数量</th></tr></thead><tbody><tr><td>精铁钱币</td><td>8</td></tr><tr><td>黄金钱币</td><td>1</td></tr><tr><td>钻石钱币</td><td>1</td></tr><tr><td>蓝宝石</td><td>1</td></tr></tbody></table><h2 id="冒险家训练场" tabindex="-1">冒险家训练场 <a class="header-anchor" href="#冒险家训练场" aria-label="Permalink to &quot;冒险家训练场&quot;">​</a></h2><p>这里的箱子非常明显，就不写了</p><p>直接看收益</p><table><thead><tr><th>项目</th><th>数量</th></tr></thead><tbody><tr><td>精铁钱币</td><td>1</td></tr><tr><td>黄金钱币</td><td>2</td></tr><tr><td>钻石钱币</td><td>1</td></tr></tbody></table><p>用盾反击败 &quot;知名的冒险家&quot; 可以得到 1 枚 钻石钱币</p><p>我把所有的 通用火枪子弹 都省下来了，后面打火枪好用</p><h2 id="冒险区" tabindex="-1">冒险区 <a class="header-anchor" href="#冒险区" aria-label="Permalink to &quot;冒险区&quot;">​</a></h2><h3 id="冒险小屋" tabindex="-1">冒险小屋 <a class="header-anchor" href="#冒险小屋" aria-label="Permalink to &quot;冒险小屋&quot;">​</a></h3><p>向上看，有个熔炉，里面有 1 个 钻石钱币</p><p><img src="'+b+'" alt=""></p><p>旁边的熔炉里有 1 个熟鸡肉</p><p>在这栋小屋箱子中可以得到</p><table><thead><tr><th>项目</th><th>数量</th></tr></thead><tbody><tr><td>精铁钱币</td><td>1</td></tr><tr><td>黄金钱币</td><td>2</td></tr><tr><td>钻石钱币</td><td>1</td></tr><tr><td>医疗包</td><td>1</td></tr><tr><td>体验卷</td><td>3</td></tr><tr><td>烤马铃薯</td><td>19</td></tr><tr><td>全回复术</td><td>3</td></tr><tr><td>力量 1</td><td>1</td></tr><tr><td>箭</td><td>3</td></tr></tbody></table><p>酿造台中可以拿到 一瓶 喷溅型速度药水</p><p><img src="'+m+'" alt=""></p><p>一楼桌子上的曲奇罐可以 下蹲+空手右键 打开，可以收到名为 “干粮” 的曲奇 16 个</p><p><img src="'+_+'" alt=""></p><h3 id="冒险者协会" tabindex="-1">冒险者协会 <a class="header-anchor" href="#冒险者协会" aria-label="Permalink to &quot;冒险者协会&quot;">​</a></h3><p>出去小屋后在坐标 672 63 -480 处上梯子</p><p>将减速的魔力转换器先存到背包，脱掉会减速的装备，最好穿可以加速的装备，同时你还可以手持一件有加速效果的装备</p><p>最好可以来瓶速度药水，比如你可以使用 <a href="#四楼">柠檬茶</a></p><p><img src="'+t+'" alt=""></p><p>跳上十字准心所指的房顶</p><p><img src="'+u+'" alt=""></p><p>下了楼梯之后（红色箭头）可以摸到 16 个精铁钱币 和 耀骑士胸甲</p><p>接着跳到绿色箭头所指的房顶，找到豁口下去</p><p><img src="'+q+'" alt=""></p><p>箱子中拿到 1 枚 钻石钱币</p><p>接着去拿图中所指位置的箱子,可以得到 耀骑士战靴</p><p><img src="'+g+'" alt=""></p><h3 id="铁匠铺" tabindex="-1">铁匠铺 <a class="header-anchor" href="#铁匠铺" aria-label="Permalink to &quot;铁匠铺&quot;">​</a></h3><p><img src="'+f+'" alt=""></p><p><a href="#冒险者协会">再次来到</a> 这个位置，跳到烟囱上</p><p>可以得到 耀骑士护腿 和 1 枚 钻石钱币</p><p><img src="'+k+'" alt=""></p><p>在烟囱底下火焰旁，墙壁上的熔炉可以拿到 妖刀村正设计图</p><h3 id="得意驴" tabindex="-1">得意驴 <a class="header-anchor" href="#得意驴" aria-label="Permalink to &quot;得意驴&quot;">​</a></h3><p>在坐标 671 64 -515 处可以在得意驴身上拿到 1 个 钻石钱币 和 1 个面包</p><h3 id="水池" tabindex="-1">水池 <a class="header-anchor" href="#水池" aria-label="Permalink to &quot;水池&quot;">​</a></h3><p>将物品丢到压力板上就会激活发射器弹出物品</p><p><img src="'+x+'" alt=""></p><p>可以得到</p><table><thead><tr><th>项目</th><th>数量</th></tr></thead><tbody><tr><td>精铁钱币</td><td>9</td></tr><tr><td>黄金钱币</td><td>13</td></tr></tbody></table><p>特别的，可以得到 1 颗 魔晶石</p><h3 id="每日宝箱" tabindex="-1">每日宝箱 <a class="header-anchor" href="#每日宝箱" aria-label="Permalink to &quot;每日宝箱&quot;">​</a></h3><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>每日宝箱的收益将不会计入最后的收益一览</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><p>黄色的每日宝箱收益：</p><table><thead><tr><th>项目</th><th>数量</th><th>概率</th></tr></thead><tbody><tr><td>金粒</td><td>4</td><td>100%</td></tr><tr><td>精铁钱币</td><td>5</td><td>100%</td></tr><tr><td>黄金钱币</td><td>2</td><td>100%</td></tr><tr><td>黄金钱币</td><td>100</td><td>1%</td></tr><tr><td>钻石钱币</td><td>1</td><td>15%</td></tr><tr><td>青铜钱币</td><td>16</td><td>1%</td></tr></tbody></table><p>特别的，黄色的每日宝箱有 1% 的概率掉落 金色的柱状武器</p><p>蓝色的魔力箱子收益：</p><table><thead><tr><th>项目</th><th>数量</th><th>概率</th></tr></thead><tbody><tr><td>精铁钱币</td><td>6</td><td>27%</td></tr><tr><td>精铁钱币</td><td>6</td><td>34%</td></tr><tr><td>魔力</td><td>1</td><td>100%</td></tr><tr><td>魔力</td><td>2</td><td>23%</td></tr><tr><td>魔力</td><td>2</td><td>15%</td></tr><tr><td>蓝宝石</td><td>16</td><td>6%</td></tr><tr><td>神奇的晶粉</td><td>1</td><td>31%</td></tr></tbody></table><p>特别的，蓝色的魔力箱子有 3% 的概率掉落 诅咒魔剑</p><h3 id="一楼" tabindex="-1">一楼 <a class="header-anchor" href="#一楼" aria-label="Permalink to &quot;一楼&quot;">​</a></h3><p>在有每日宝箱的这个楼层，可以在箱子中找到 4 个 黄金钱币 和 5 个名为 “5周年爱心饼干” 的曲奇</p><p><img src="'+P+'" alt=""></p><p>每日宝箱后的房间中，箭头所指的箱子内有 16 只箭</p><p><img src="'+y+'" alt=""></p><h3 id="二楼" tabindex="-1">二楼 <a class="header-anchor" href="#二楼" aria-label="Permalink to &quot;二楼&quot;">​</a></h3><p>没找到宝箱</p><h3 id="三楼" tabindex="-1">三楼 <a class="header-anchor" href="#三楼" aria-label="Permalink to &quot;三楼&quot;">​</a></h3><p>在新武器研究员这里的箱子可以得到 16 枚名为 “Musket Round” 的火枪子弹</p><p>坐标参考：686 76 -490</p><p><img src="'+v+'" alt=""></p><h3 id="四楼" tabindex="-1">四楼 <a class="header-anchor" href="#四楼" aria-label="Permalink to &quot;四楼&quot;">​</a></h3><p>领袖面对的方向，桌子上可以右键得到一瓶柠檬茶</p><p><img src="'+w+'" alt=""></p><p>在你面对领袖时，右手方向的门中可以</p><p>在箭头所指的漏斗中找到 1 个收集品 “冒险者的宣誓——BY塞弗尔·威”</p><p><img src="'+S+'" alt=""></p><p>在面对领袖时。左手方向的们中可以看到一个展示盒</p><p>空手右键可以取下里面的 1 个 钻石钱币</p><p><img src="'+t+'" alt=""></p><h3 id="屋顶" tabindex="-1">屋顶 <a class="header-anchor" href="#屋顶" aria-label="Permalink to &quot;屋顶&quot;">​</a></h3><p>在你面对领袖时，右手方向的门中可以看到这幅画</p><p>画的右半部分可穿过</p><p><img src="'+C+'" alt=""></p><p>出去之后向左走，找到</p><p><img src="'+T+'" alt=""></p><p>参考坐标 691 81 -509</p><p>爬上梯子，在信标旁可以找到一个箱子，箱子里是 苍白断剑</p><p>坐标 690 90 -503</p><h3 id="弓箭手·神准箭" tabindex="-1">弓箭手·神准箭 <a class="header-anchor" href="#弓箭手·神准箭" aria-label="Permalink to &quot;弓箭手·神准箭&quot;">​</a></h3><p>在 穿过画向由走 或在 屋顶 拿完箱子后跳下去，可以找到这个 npc</p><p>他旁边的箱子里有 1 个收集品 “冒险者之剑”</p><p><img src="'+A+'" alt=""></p><p>坐标 684 80 -506</p><h3 id="树上箱子" tabindex="-1">树上箱子 <a class="header-anchor" href="#树上箱子" aria-label="Permalink to &quot;树上箱子&quot;">​</a></h3><p><img src="'+B+'" alt=""></p><p>里面有 16 个 精铁钱币</p><p>坐标 684 77 -526</p><h3 id="帆上箱子" tabindex="-1">帆上箱子 <a class="header-anchor" href="#帆上箱子" aria-label="Permalink to &quot;帆上箱子&quot;">​</a></h3><p>在树上，你可以跳到帆上，拿到 耀骑士头盔</p><p><img src="'+N+'" alt=""></p><h3 id="矮人的商船" tabindex="-1">矮人的商船 <a class="header-anchor" href="#矮人的商船" aria-label="Permalink to &quot;矮人的商船&quot;">​</a></h3><p><img src="'+V+'" alt=""></p><p>在 帆上箱子 旁的 矮人矮人商船 可以找到 1 个蓝宝石（图中准星所指箱子）</p><h3 id="风车" tabindex="-1">风车 <a class="header-anchor" href="#风车" aria-label="Permalink to &quot;风车&quot;">​</a></h3><p><img src="'+D+'" alt=""></p><p>参考坐标 624 69 -530</p><h4 id="底部" tabindex="-1">底部 <a class="header-anchor" href="#底部" aria-label="Permalink to &quot;底部&quot;">​</a></h4><p>进入底部，杀掉恶犬，从旁边的箱子中可以得到</p><table><thead><tr><th>项目</th><th>数量</th></tr></thead><tbody><tr><td>金粒</td><td>2</td></tr><tr><td>精铁钱币</td><td>6</td></tr></tbody></table><h4 id="背面" tabindex="-1">背面 <a class="header-anchor" href="#背面" aria-label="Permalink to &quot;背面&quot;">​</a></h4><p>坐标 597 88 -553</p><p>可以从箱子中得到</p><table><thead><tr><th>项目</th><th>数量</th></tr></thead><tbody><tr><td>黄金钱币</td><td>2</td></tr><tr><td>魔力</td><td>1</td></tr></tbody></table><p>以及 1 把 火焰弓</p><h4 id="内部" tabindex="-1">内部 <a class="header-anchor" href="#内部" aria-label="Permalink to &quot;内部&quot;">​</a></h4><p>使用电梯上到顶楼，可以得到</p><table><thead><tr><th>项目</th><th>数量</th></tr></thead><tbody><tr><td>金粒</td><td>3</td></tr><tr><td>精铁钱币</td><td>4</td></tr></tbody></table><p>注：抬头可以看到装金粒的箱子</p><h3 id="罐子" tabindex="-1">罐子 <a class="header-anchor" href="#罐子" aria-label="Permalink to &quot;罐子&quot;">​</a></h3><p>在树下 坐标 621 65 -486 处可以找到三个罐子</p><p>可以使用 冒险家训练场 的魔力剑来开罐子</p><table><thead><tr><th>项目</th><th>数量</th><th>概率</th></tr></thead><tbody><tr><td>幽灵核心</td><td>1</td><td>20%</td></tr><tr><td>金粒</td><td>1</td><td>100%</td></tr><tr><td>精铁钱币</td><td>1</td><td>100%</td></tr><tr><td>神圣洗礼</td><td>1</td><td>5%</td></tr><tr><td>罐中剑</td><td>1</td><td>1%</td></tr><tr><td>罐中盔</td><td>1</td><td>2%</td></tr><tr><td>罐中弓</td><td>1</td><td>2%</td></tr><tr><td>治疗药水</td><td>1</td><td>50%</td></tr></tbody></table><h3 id="桥下" tabindex="-1">桥下 <a class="header-anchor" href="#桥下" aria-label="Permalink to &quot;桥下&quot;">​</a></h3><p>在 风车 和 罐子 两点连线经过的桥</p><p><img src="'+E+'" alt=""></p><p>感谢群友 回首萧瑟处依旧逍 提供的图片</p><h4 id="箱子" tabindex="-1">箱子 <a class="header-anchor" href="#箱子" aria-label="Permalink to &quot;箱子&quot;">​</a></h4><p>在 风车 和 罐子 两点连线经过的桥底下有一个箱子</p><p>可以拿到一个红宝石</p><h4 id="地洞" tabindex="-1">地洞 <a class="header-anchor" href="#地洞" aria-label="Permalink to &quot;地洞&quot;">​</a></h4><p>地洞里，朝着岩浆右键可以打开一个熔炉</p><p>有一把名为 “绯” 的吸血刀</p><p>参考坐标 612 50 -503</p><p><img src="'+$+'" alt=""></p><h3 id="收益-1" tabindex="-1">收益 <a class="header-anchor" href="#收益-1" aria-label="Permalink to &quot;收益&quot;">​</a></h3><table><thead><tr><th>项目</th><th>数量</th></tr></thead><tbody><tr><td>精铁钱币</td><td>50</td></tr><tr><td>黄金钱币</td><td>24</td></tr><tr><td>钻石钱币</td><td>4</td></tr><tr><td>蓝宝石</td><td>1</td></tr><tr><td>红宝石</td><td>1</td></tr></tbody></table><h2 id="魔法师协会" tabindex="-1">魔法师协会 <a class="header-anchor" href="#魔法师协会" aria-label="Permalink to &quot;魔法师协会&quot;">​</a></h2><h3 id="三楼-1" tabindex="-1">三楼 <a class="header-anchor" href="#三楼-1" aria-label="Permalink to &quot;三楼&quot;">​</a></h3><p>在图中的电梯方块上二楼</p><p><img src="'+M+'" alt=""></p><p>接着，在箭头所指的电梯方块上三楼</p><p><img src="'+H+'" alt=""></p><p>前往箭头所指的房间，里面箱子里有 1 个 魔力尘</p><p><img src="'+I+'" alt=""></p><h3 id="空气方块跑酷" tabindex="-1">空气方块跑酷 <a class="header-anchor" href="#空气方块跑酷" aria-label="Permalink to &quot;空气方块跑酷&quot;">​</a></h3><p>回到门口，这里有一小段空气方块跑酷</p><p><img src="'+R+'" alt=""></p><p>有一个大箱子，可以得到三张 扑克 梅花Q</p><p><img src="'+W+'" alt=""></p><h3 id="索罗商贩·阿银" tabindex="-1">索罗商贩·阿银 <a class="header-anchor" href="#索罗商贩·阿银" aria-label="Permalink to &quot;索罗商贩·阿银&quot;">​</a></h3><p>在阿银旁边有个箱子，可以拿到一瓶 魔力涌动</p><p>坐标 641 69 -437</p><p><img src="'+X+'" alt=""></p><h2 id="土豪区" tabindex="-1">土豪区 <a class="header-anchor" href="#土豪区" aria-label="Permalink to &quot;土豪区&quot;">​</a></h2><h3 id="一楼-1" tabindex="-1">一楼 <a class="header-anchor" href="#一楼-1" aria-label="Permalink to &quot;一楼&quot;">​</a></h3><p>这个是个投掷器，不是活塞</p><p>里面有 4 个面包和 1 个 黄金钱币</p><p><img src="'+Z+'" alt=""></p><p>猪猪里头有 1 个金粒</p><p><img src="'+J+'" alt=""></p><p>猪猪面对的画后面的空间内有 24 个精铁钱币</p><p><img src="'+O+'" alt=""></p><p>电梯右侧的空间的桌子上可以拿到一些食物</p><p><img src="'+Q+'" alt=""></p><h3 id="负一楼" tabindex="-1">负一楼 <a class="header-anchor" href="#负一楼" aria-label="Permalink to &quot;负一楼&quot;">​</a></h3><p>可前往外面码头</p><p><img src="'+U+'" alt=""></p><p>可在图左侧的船上找到</p><table><thead><tr><th>项目</th><th>数量</th></tr></thead><tbody><tr><td>精铁钱币</td><td>1</td></tr><tr><td>黄金钱币</td><td>2</td></tr></tbody></table><p>你还可以看到 336 58 -584 处有个箱子</p><p><img src="'+Y+'" alt=""></p><p>箱子里是一把 +20% 移速的剑</p><p><img src="'+j+'" alt=""></p><h3 id="负二楼" tabindex="-1">负二楼 <a class="header-anchor" href="#负二楼" aria-label="Permalink to &quot;负二楼&quot;">​</a></h3><p>传送水晶</p><h3 id="二楼-1" tabindex="-1">二楼 <a class="header-anchor" href="#二楼-1" aria-label="Permalink to &quot;二楼&quot;">​</a></h3><p>桌子上总共可以拿到 7 个精铁钱币</p><h3 id="三楼-2" tabindex="-1">三楼 <a class="header-anchor" href="#三楼-2" aria-label="Permalink to &quot;三楼&quot;">​</a></h3><p>桌子上可以拿到 1 个金苹果</p><p>蹲下 + 空手右键 可以打开展示盒，右键拿取物品</p><p>左侧展示柜可以拿到 1 个奶油面包和 1 个 黄金钱币</p><p><img src="'+z+'" alt=""></p><p>电梯后面的房间可以拿到 5 个 精铁钱币 和 1 个金粒</p><p><img src="'+F+'" alt=""></p><h3 id="四楼-1" tabindex="-1">四楼 <a class="header-anchor" href="#四楼-1" aria-label="Permalink to &quot;四楼&quot;">​</a></h3><p>可以前往 <a href="#线路①-四楼">金库</a></p><h3 id="商贩" tabindex="-1">商贩 <a class="header-anchor" href="#商贩" aria-label="Permalink to &quot;商贩&quot;">​</a></h3><p><img src="'+G+'" alt=""></p><p>从左到右三个箱子分别是：</p><p>浆果汁 x 3</p><p>红色的果实 x5</p><p>黄金钱币 x 5 和 银色的戒指</p><h3 id="情报商人的家" tabindex="-1">情报商人的家 <a class="header-anchor" href="#情报商人的家" aria-label="Permalink to &quot;情报商人的家&quot;">​</a></h3><p>商贩旁边。坐标参考 436 67 -532</p><p><img src="'+K+'" alt=""></p><p>通过电梯上到顶楼，可以拿到</p><p><img src="'+L+'" alt=""></p><p>通过电梯下到负一楼，可以拿到 2 个 黄金钱币</p><p>还能找 巴尔 玩玩</p><p>注：第一章接任务之后 巴尔 就会消失</p><p><img src="'+tt+'" alt=""></p><h3 id="金库" tabindex="-1">金库 <a class="header-anchor" href="#金库" aria-label="Permalink to &quot;金库&quot;">​</a></h3><p>金库中可以从箱子拿到 29 个 黄金钱币</p><h4 id="线路1-四楼" tabindex="-1">线路①-四楼 <a class="header-anchor" href="#线路1-四楼" aria-label="Permalink to &quot;线路①-四楼&quot;">​</a></h4><p>站在玻璃上向对面的建筑跳</p><p><img src="'+at+'" alt=""></p><p><img src="'+a+'" alt=""></p><h4 id="线路2-商贩" tabindex="-1">线路②-商贩 <a class="header-anchor" href="#线路2-商贩" aria-label="Permalink to &quot;线路②-商贩&quot;">​</a></h4><p>可以在准信所指的地方跳上商贩的帐篷上</p><p><img src="'+rt+'" alt=""></p><p>很自然的从这调过来</p><p><img src="'+dt+'" alt=""></p><p><img src="'+a+'" alt=""></p><h4 id="方法1-远程" tabindex="-1">方法①-远程 <a class="header-anchor" href="#方法1-远程" aria-label="Permalink to &quot;方法①-远程&quot;">​</a></h4><p>把 金库看守者·埃德蒙 引到绿色箭头的位置，保持仇恨，在红色位置远程攻击他</p><p><img src="'+et+'" alt=""></p><p>金库看守者·埃德蒙 掉落：</p><table><thead><tr><th>项目</th><th>数量</th><th>概率</th></tr></thead><tbody><tr><td>黄金钱币</td><td>64</td><td>100%</td></tr><tr><td>钻石钱币</td><td>1</td><td>100%</td></tr><tr><td>绿色的粘浊液体</td><td>1</td><td>100%</td></tr><tr><td>西装</td><td>1</td><td>25%</td></tr></tbody></table><h4 id="方法2-走位" tabindex="-1">方法②-走位 <a class="header-anchor" href="#方法2-走位" aria-label="Permalink to &quot;方法②-走位&quot;">​</a></h4><p>金库看守者·埃德蒙 视力不太好，进去趁他不注意拿了箱子赶紧走</p><h3 id="酒馆" tabindex="-1">酒馆 <a class="header-anchor" href="#酒馆" aria-label="Permalink to &quot;酒馆&quot;">​</a></h3><p>坐标参考 425 67 -563</p><p><img src="'+pt+'" alt=""></p><p>调酒师背后的架子可以拿到 6 瓶酒</p><h3 id="红床房" tabindex="-1">红床房 <a class="header-anchor" href="#红床房" aria-label="Permalink to &quot;红床房&quot;">​</a></h3><p>坐标参考 423 67 -558</p><p><img src="'+ht+'" alt=""></p><p>地上的曲奇罐有 8 个 黄金钱币</p><h3 id="苞谷家" tabindex="-1">苞谷家 <a class="header-anchor" href="#苞谷家" aria-label="Permalink to &quot;苞谷家&quot;">​</a></h3><p>走迷宫进，坐标参考 408 68 -576</p><p>或者去 泳池 ，从图中指的路的过去</p><p><img src="'+it+'" alt=""></p><p>苞谷家二楼可以看到这个货架</p><p><img src="'+st+'" alt=""></p><p>转个身，看到：</p><p>左侧房间的熔炉有 3 个金粒 和 1 个花瓣</p><p>右侧房间的箱子有 1 个钻石钱币</p><p><img src="'+lt+'" alt=""></p><p>去到三楼，还可以找到 1 个钻石钱币 和 1 个金粒 <s>和一根萝卜</s></p><p><img src="'+ot+'" alt=""></p><p>苞谷家可以搜刮到这些：</p><table><thead><tr><th>项目</th><th>数量</th></tr></thead><tbody><tr><td>金粒</td><td>13</td></tr><tr><td>精铁钱币</td><td>1</td></tr><tr><td>黄金钱币</td><td>1</td></tr><tr><td>钻石钱币</td><td>2</td></tr><tr><td>青铜钱币</td><td>1</td></tr><tr><td>绿宝石钱币</td><td>1</td></tr><tr><td>蓝宝石</td><td>1</td></tr></tbody></table><p>注：金锭换算成 9 个金粒</p><h3 id="收益-2" tabindex="-1">收益 <a class="header-anchor" href="#收益-2" aria-label="Permalink to &quot;收益&quot;">​</a></h3><table><thead><tr><th>项目</th><th>数量</th></tr></thead><tbody><tr><td>金粒</td><td>15</td></tr><tr><td>精铁钱币</td><td>38</td></tr><tr><td>黄金钱币</td><td>113</td></tr><tr><td>钻石钱币</td><td>3</td></tr><tr><td>青铜钱币</td><td>1</td></tr><tr><td>绿宝石钱币</td><td>1</td></tr><tr><td>蓝宝石</td><td>1</td></tr></tbody></table><p>所以土豪区确实富</p><h2 id="亡灵村" tabindex="-1">亡灵村 <a class="header-anchor" href="#亡灵村" aria-label="Permalink to &quot;亡灵村&quot;">​</a></h2><h3 id="建筑" tabindex="-1">建筑 <a class="header-anchor" href="#建筑" aria-label="Permalink to &quot;建筑&quot;">​</a></h3><p>这里可以拿到 3 个 黄金钱币，坐标参考 546 72 -568</p><p><img src="'+nt+'" alt=""></p><p>这里可以拿到 1 金粒，坐标参考 542 79 -528</p><p><img src="'+ct+'" alt=""></p><p>543 79 -541 处的房子是一段空气方块跑酷，可以拿到 2 个 钻石钱币 和 1 个花瓣</p><p><img src="'+bt+'" alt=""></p><h3 id="宝箱怪" tabindex="-1">宝箱怪 <a class="header-anchor" href="#宝箱怪" aria-label="Permalink to &quot;宝箱怪&quot;">​</a></h3><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>宝箱怪的收益将不会计入最后的收益一览</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><p>519 74 -515 附近有一个宝箱怪</p><table><thead><tr><th>项目</th><th>数量</th><th>概率</th></tr></thead><tbody><tr><td>金粒</td><td>8</td><td>50%</td></tr><tr><td>精铁钱币</td><td>10</td><td>50%</td></tr><tr><td>黄金钱币</td><td>10</td><td>50%</td></tr><tr><td>钻石钱币</td><td>2</td><td>50%</td></tr><tr><td>青铜钱币</td><td>8</td><td>50%</td></tr><tr><td>蓝宝石</td><td>1</td><td>50%</td></tr><tr><td>红宝石</td><td>1</td><td>50%</td></tr><tr><td>紫宝石</td><td>1</td><td>50%</td></tr></tbody></table><h3 id="收益-3" tabindex="-1">收益 <a class="header-anchor" href="#收益-3" aria-label="Permalink to &quot;收益&quot;">​</a></h3><table><thead><tr><th>项目</th><th>数量</th></tr></thead><tbody><tr><td>金粒</td><td>1</td></tr><tr><td>黄金钱币</td><td>3</td></tr><tr><td>钻石钱币</td><td>2</td></tr></tbody></table>',282),ut=[_t];function qt(gt,ft,kt,xt,Pt,yt){return e(),d("div",null,ut)}const St=r(mt,[["render",qt]]);export{wt as __pageData,St as default};
